import React from 'react';
import { Row, Col } from 'antd';
import AppLayout from '../components/Applayout';

const Profile = () => {
  const a = 'Profile';
  return (
    <AppLayout>
      <Row style={{ backgroundColor: 'red', height: '120px' }}>
        <img src="https://user-images.githubusercontent.com/39295881/86443625-84b67100-bd4a-11ea-9331-08b3cd70c073.png" alt="back" />
      </Row>
      <Row>
        <Col span={12}>col-6</Col>
        <Col span={12}>col-6</Col>
      </Row>
    </AppLayout>
  );
};

export default Profile;
